import { NavBarStyle, LinkStyle, IconImage, ErrorDiv, ErrorLink } from "../styled-components/NavbarStyle"

import React from 'react'
import {connect} from 'react-redux'


function NavbarInfo(props) {


	return (
		<div>
		<NavBarStyle>





			{props.isLoggedIn ? <div><LinkStyle to="/cart" >Cart</LinkStyle></div> : null}



			{props.isLoggedIn ? null :<LinkStyle to="/register">Register</LinkStyle>}

			{props.isLoggedIn ? null :<LinkStyle to="/login">Login</LinkStyle>}

			{props.isLoggedIn ?<LinkStyle to="/account">Account</LinkStyle> : null}

			</NavBarStyle>
			</div>
	)
}


const mapStateToProps = (state) => {
	return {
		isLoggedIn: state.isLoggedIn
	}
}

export default connect(mapStateToProps)(NavbarInfo)
